import "./ContainerThree.css";

const ContainerThree = () => {
  return (
    <div className="container-three">
      <img
        className="diversimg"
        src="/images/diversity.png"
        alt="diversity-img"
      ></img>
      <div className="text">
        <h1 className="beyond">Beyond Law and Definitions</h1>
        <p>
          From Law terminology to translations, we've got you covered, but at
          AccessiLaw our main goal is to provide everyone with equal oppertunity in
          any legal challenge.
        </p>
      </div>
    </div>
  );
};

export default ContainerThree;
